import React, { Component } from 'react'
import './App.css'

function msgPrint () {
  console.log('oioi')
}
function msgPrint2 () {
  console.log('sei la')
}
function msgPrint3 () {
  console.log('bom dia')
}
export default class App extends Component {
  render() {
    return (
      <div>
        <button onClick={msgPrint}>Mybutton</button>
        <button onClick={msgPrint2}>Mybutton</button>
        <button onClick={msgPrint3}>Mybutton</button>
      </div>
    )
  }
}
